use std::collections::HashMap;

fn main() {
    println!("Hello, world!");
}

const MOD: u64 = 1_000_000_007;
const P: u64 = 26;

fn longest_dup_substring(s: String) -> String {
    let mut lo = 0;
    let mut hi = s.len();
    let mut res = "".to_string();
    let s: Vec<char> = s.chars().collect();
    let n = s.len();
    while lo < hi {
        let mid = (lo + hi + 1) / 2;
        if let Some(s) = exist(mid, &s, n) {
            res = s;
            lo = mid;
        } else {
            hi = mid - 1;
        }
    }
    res
}

fn exist(size: usize, s: &[char], n: usize) -> Option<String> {
    let mut pos: HashMap<u64, usize> = HashMap::new();
    let mut hash: u64 = 0;
    let mut pn: u64 = 1;
    for i in 0..size {
        hash *= P;
        hash += (s[i] as u8 - b'a') as u64;
        hash %= MOD;
        pn *= P;
        pn %= MOD;
    }
    pos.insert(hash, size);
    for i in size..n {
        hash *= P;
        hash += (s[i] as u8 - b'a') as u64;
        hash += MOD;
        hash -= (pn * (s[i - size] as u8 - b'a') as u64) % MOD;
        hash %= MOD;
        if let Some(end) = pos.insert(hash, i + 1) {
            if s[end - size..end] == s[i + 1 - size..=i] {
                return Some(s[i + 1 - size..=i].iter().copied().collect::<String>());
            }
        }
    }
    None
}

#[cfg(test)]
mod tests {
    use crate::longest_dup_substring;

    #[test]
    fn test_1() {
        let s = "banana".to_string();
        assert_eq!(longest_dup_substring(s), "ana".to_string());
    }

    #[test]
    fn test_2() {
        let s = "abcd".to_string();
        assert_eq!(longest_dup_substring(s), "".to_string());
    }

    #[test]
    fn test_extra() {
        let s = "".to_string();
        let res = "aeeebaabd".to_string();
        assert_eq!(longest_dup_substring(s), res);
        let s = "".to_string();
        let res = "maoli".to_string();
        assert_eq!(longest_dup_substring(s), res);
        let s = "".to_string();
        let res = "ddbcddbabee".to_string();
        assert_eq!(longest_dup_substring(s), res);
    }
}
